$(document).ready(function(){$("#sign-btn").on("click",function(t){$(t.currentTarget).closest("ul").hide(),$("form#signin").fadeIn("fast")});$(window).scroll(function(){500<$(this).scrollTop()?$(".back-to-top").fadeIn(300):$(".back-to-top").fadeOut(300)}),$(".back-to-top a").click(function(t){return t.preventDefault(),$("html, body").animate({scrollTop:0},300),!1}),$('[data-toggle="tooltip"]').tooltip(),$("#button-features").click(function(){return $("#features-main").load("index.html #features-main"),!1}),$("#button-brands").click(function(){return $("#features-main").load("features1.html #brands"),!1}),$("#button-innovations").click(function(){return $("#features-main").load("features2.html #innovations"),!1})});